import { Component, ViewChild, ElementRef } from '@angular/core';
import { NavParams, ViewController } from 'ionic-angular';
import Cropper from 'cropperjs';

@Component({
  selector: 'crop-image',
  templateUrl: 'cropper.html'
})
export class CropperPage {
  @ViewChild('image') input: ElementRef;
  imageBase64: any;
  width: number;
  height: number;
  cropper: Cropper;
  cropperOptions: any;

  constructor(public viewCtrl: ViewController, public navParams: NavParams) {
    // this.imageBase64 = 'data:image/jpeg;base64,' + this.navParams.get('imagen');
    this.imageBase64 = foto;
    this.width = 50;
    this.height = 50;
    //Set your required cropperJS options as seen here https://github.com/fengyuanchen/cropperjs/blob/master/README.md#options
    this.cropperOptions = {
      dragMode: 'move',
      aspectRatio: this.width / this.height,
      modal: true,
      guides: false,
      highlight: true,
      center: true,
      background: true,
      autoCrop: true,
      movable: false,
      zoomable: false,
      autoCropArea: 0.8,
      responsive: true,
      cropBoxMovable: true,
      cropBoxResizable: true,
      scalable: false,
      crop: (e) => { }
    };
  }

  ionViewDidLoad() {
  }
  
  cargarCropper(){
    this.cropper = new Cropper(this.input.nativeElement, this.cropperOptions);
  }


  cropperReset() { this.cropper.reset() }

  imageRotate() { this.cropper.rotate(90); }

  cancel() { this.viewCtrl.dismiss(); }

  finish() {
    let croppedImgB64String: string = this.cropper.getCroppedCanvas().toDataURL('image/jpeg', (100 / 100));
    console.log('â€‹CropperPage -> finish -> croppedImgB64String', croppedImgB64String);
    // this.viewCtrl.dismiss(croppedImgB64String);
  }
}


